import React from 'react';
import classes from './Button.module.css';

const button = props => {
    const modifiedClasses = [classes.Button];
    modifiedClasses.push('Disabled');
    return(
        <button className={modifiedClasses.join(' ')} onClick={props.clicked} >
            {props.children}
        </button>
    );
}

export default button;
